import React from 'react';
import './LogPanel.css';

export default function LogPanel({ visible, data }) {
  if (!visible) return null;

  return (
    <div className="log-panel">
      <h3>📋 לוג פעילות</h3>
      <div className="log-content">
        {data.map((item, idx) => {
          if (item.properties.type !== 'alien') return null;

          const { alienCode, municipality } = item.properties;
          const [lng, lat] = item.geometry.coordinates;

          return (
            <div key={idx} className="log-entry">
              👽 {alienCode} –
              {municipality && municipality !== 'לא ידוע'
                ? ` ברשות: ${municipality}`
                : ` קואורדינטות: ${lat.toFixed(5)}, ${lng.toFixed(5)}`}
            </div>
          );
        })}
      </div>
    </div>
  );
}
